    SELECT sum(incomes.nominal) into hasil FROM `incomes` join cicilans on cicilans.id = incomes.cicilan_id join payment_details on payment_details.id = cicilans.payment_detail_id join payments on payments.id = payment_details.payment_id join students on students.id = payments.student_id WHERE DATE(incomes.created_at) = tanggal and students.id = murid;
